    time: "6pm",
  },
  {
    id: "e2",
    name: "independenceDay",
    place: "kalyanpur",
    date: "15 aug 2024",
    time: "8am",
  },
  {
    id: "e3",
    name: "rakshaBandhan",
    place: "bithoor",
    date: "15 aug 2024",
    time: "9:45pm",
  },
];
function EventsPage() {
  return <div>EventsPage</div>;
}

